set autocommit=0;
INSERT INTO `block_custom` VALUES (1,'<p>This is the Grid/Thumbnail Browser included on RealEstate. Here your visitors can explore all your stock of houses, filter them by Make, body style, order the results and many more features. This is a sample block filled with &quot;lorem ipsum&quot; stuff. Donec malesuada ullamcorper nibh et venenatis. Vivamus eu quam diam, sit amet gravida ipsum. Maecenas vitae adipiscing mauris.</p>\r\n','RealEstate - Properties Browser Intro Block','filtered_html'),(2,'<p>This is a Premium theme you can easily set up for your business. Curabitur lorem orci, varius eu gravida quis, blandit eu lacus. Cras lorem magna, viverra ac facilisis vitae, porttitor sed massa. Donec condimentum justo vitae lectus blandit molestie porta nulla tincidunt. Nulla egestas faucibus tincidunt. Vivamus fermentum libero vel felis aliquet interdum. Aliquam nibh dolor, vehicula eget condimentum ut, eleifend blandit felis. Nunc a ligula non velit semper pretium. Maecenas in diam nisi. Donec congue sagittis mi sit amet tincidunt.</p>\r\n','RealEstate - About Us','filtered_html'),(3,'<p>Copyright 2018. Place here your Copyright and License info</p>\r\n','RealEstate - Copyright and License Block','filtered_html'),(4,'<p><a href=\"http://drupal.org\">Drupal</a> 7 Premium Theme created by <a href=\"http://doublemthemes.com\">DoubleMThemes</a> for <a href=\"http://www.themesnap.com/premium-drupal-themes/realestate.html?ref=5907\">ThemeSnap</a></p>\r\n','RealEstate - Right Closure Block','filtered_html'),(5,'<h3>\r\n	Welcome to Real<span style=\"color:#3399ff;\">Estate</span>, the HTML5 &amp; CSS3 Drupal 7 theme you&#39;ve been looking for your Agency. Listing, Agents, Maps, Contact Forms...</h3>\r\n','RealEstate - Welcome Message Block','full_html'),(6,'Call Us: 0-800-123-4567','RealEstate - Phone Number Block','plain_text'),(8,'<p>In this map you can find where we are located, in case you&#39;re close or just want to come and give a look. Sed quis turpis mi. Fusce elementum commodo justo quis sollicitudin. Sed vitae nisi eget metus semper congue. Suspendisse sit amet nunc eu leo fermentum dignissim sit amet in metus.&nbsp;</p>\r\n<p>Praesent id mauris urna, et tristique lectus. Nulla facilisi. Sed sed lorem non elit volutpat sodales eget id velit.&nbsp;</p>\r\n','RealEstate - Map Intro','full_html'),(9,'<p>Suspendisse sed magna eget tellus suscipit elementum eget vitae arcu. maecenas sodales hendrerit porta. phasellus nisl tellus, aliquam quis dignissim non, consectetur vel purus. aliquam at lectus felis, vel lacinia arcu. nam enim libero, lacinia a tristique a, accumsan sed purus. nullam eros metus, rhoncus eget adipiscing nec, interdum in magna. aenean volutpat leo vel enim fringilla vestibulum.</p>\r\n','RealEstate - Contact Info','filtered_html'),(10,'<p>Here you can explain your visitors they&#39;re browsing all your properties using a beautiful Google Map V3 API integrated View. It fits automatically to all your properties. Quisque dolor nulla, placerat eu ultricies id, congue sit amet libero. Aenean non ante eget arcu posuere semper ut a orci. Quisque in sapien et neque sodales facilisis.&nbsp;</p>\r\n','RealEstate - All Properties Intro','filtered_html'),(11,'<div id=\"calc-selectors\">\r\n<div class=\"mortgage-data\"><span class=\"labels\">Property Price:</span><div id=\"propprice\"></div></div><div class=\"mortgage-data\"><span class=\"labels\">Initial Payment:</span><span id=\"initialpayment-value\"></span><div id=\"initialpayment\" ></div><div id=\"initial\"></div></div></div><div id=\"calc-selectors-2\"><div class=\"clear\"></div><div class=\"mortgage-data\"><span  class=\"labels\">Interest Rate:</span><span id=\"tax-value\"></span><div  id=\"tax\" ></div><div id=\"taxes\"></div></div><div class=\"clear\"></div><div class=\"mortgage-data years\"><span class=\"labels\">Loan Term (in Years): </span><span id=\"payments-value\"></span><div  id=\"timer\" ></div><div id=\"paymentTime\"></div></div><div class=\"clear\"></div></div><div id=\"mortgage\">Mortgage Payment: </div><div id=\"pago\"></div><div class=\"clear\"></div>','RealEstate - Mortgage Calculator','full_html'),(12,'<h3>What you have been looking can\'t be found. Maybe it was removed or it was a bad link. So please, feel free to continue exploring our site.</h3>','404 Message','full_html');
