 get a site exactly as this one you&#39;re browsing as a demo.</p>\r\n<p><img alt=\"RealEstate Premium Drupal 7 Theme - Theme Features\" src=\"/realestate/sites/default/files/features/theme-features.jpg\" style=\"width: 746px; height: 602px;\" /></p>\r\n<p>NOTE: House Images included on the demo are properly licensed by DoubleMThemes and are not distributed on the downloadable package due to Copyright reasons. Gray sample images were used instead.&nbsp;</p>\r\n<p>All RealEstate Icons used on Maps were generated on&nbsp;http://mapicons.nicolasmollet.com/category/markers/offices/real-estate/ and are free for commercial use.</p>\r\n','','full_html'),('node','page',0,38,38,'und',0,'<p>The Properties Browser is the hearth of RealEstate. Is the tool your visitors use to browse the entire collection of properties, to compare the ones they like, to filter, sort, and even print the offers they want to evaluate with their friends at home. The Properties Browser is the tool that allows visitor to get what they want.</p>\r\n<p><img alt=\"Advanced Car Browser included on CarDealer Premium Drupal Theme\" src=\"/realestate/sites/default/files/features/browser.jpg\" style=\"width: 746px; height: 688px;\" /></p>\r\n<h3>\r\n	3 Properties Views in 1</h3>\r\n<p>The <strong>Thumbnail View</strong> is the most easy way to browse the properties on your collection. It presents all properties on a set of 3 columns showing the first and most important photo of each.&nbsp;</p>\r\n<p>Visitors can filter properties, change the ammount per page, define an order and so. It also shows a Google Map API 3 with all matching properties.</p>\r\n<p>The<strong> List View</strong> inherits the filters of the Thumbnail View allowing your visitors to explore properties using a clean list layout classically used on classified content display.</p>\r\n<p>The <strong>Compare View</strong> shows up to 3 properties selected by visitors comparing their features on a horizontal table. Properties can be selected from both Tumbnail and List Views.</p>\r\n','','full_html'),('node','property',0,40,40,'und',0,'<p>Nulla consequat, libero vitae bibendum semper, magna nulla pellentesque odio, non cursus turpis velit et diam. In vulputate mattis ipsum vitae vehicula. Sed posuere fringilla lorem, et pulvinar mauris vehicula quis. Integer bibendum auctor ante at egestas. Donec iaculis sagittis ante in pretium. Nullam eu lacus in nibh rutrum ornare at eget tellus. Praesent congue nisi in metus malesuada nec dictum nunc egestas. In id elit nulla. Aliquam erat volutpat. Duis at libero sapien. Etiam mollis mi vitae mi cursus elementum.&nbsp;</p>\r\n<p>Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Maecenas tellus mauris, vestibulum nec sagittis dignissim, malesuada at ante. Donec ac lectus vel nulla pretium porta tempus eget tortor. Vestibulum a tincidunt magna. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Etiam est velit dignissim quis, accumsan et diam. Lorem ipsum dolor sit amet, consectetur adipiscing elit.&nbsp;</p>\r\n','','full_html'),('node','page',0,41,41,'und',0,'<p>Car Page is the core of car&#39;s info in CarDealer. It provides your visitors all the info of each car, allows your visitors to get in contact with you requesting for that car and shows a set of complementary navigation ways such as &quot;Other Sedan you might also like&quot; or &quot;Other Mercedes-Benz cars&quot;, very usefull for visitors who get into dead end points and still can&#39;t find what they&#39;re looking for.</p>\r\n<p><img alt=\"\" ilo-full-src=\"http://localhost/themesnap.com/carsdealer-release/sites/default/files/features/car-page.jpg\" src=\"/themesnap.com/carsdealer-release/sites/default/files/features/car-page.jpg\" style=\"width: 746px; height: 657px;\" /></p>\r\n<h3>\r\n	Car Features</h3>\r\n<p>For each car, you can define:</p>\r\n<ul>\r\n	<li>\r\n		As many pictures as you want (we recommend to use at least 5)</li>\r\n	<li>\r\n		Price</li>\r\n	<li>\r\n		Make</li>\r\n	<li>\r\n		Model</li>\r\n	<li>\r\n		Body Style</li>\r\n	<li>\r\n		Year</li>\r\n	<li>\r\n		Miles</li>\r\n	<li>\r\n		Transmission</li>\r\n	<li>\r\n		Cylinders</li>\r\n	<li>\r\n		EPA Mileage for City and Highway</li>\r\n	<li>\r\n		Color</li>\r\n	<li>\r\n		Doors</li>\r\n	<li>\r\n		Fuel Type</li>\r\n	<li>\r\n		Overview and Description</li>\r\n	<li>\r\n		Equipment Features</li>\r\n	<li>\r\n		Safety Features</li>\r\n	<li>\r\n		Comfort Features</li>\r\n	<li>\r\n		Entertainment Features</li>\r\n</ul>\r\n<h3>\r\n	Contact Form</h3>\r\n<p>CarDealer automatically sets a contact form for each Car. It allows your visitors to rapidly send you a message already contextualized telling you which Car they&#39;re interested on. This contact form also includes a Captcha verification to avoid SPAM sumbissions as a security feature.</p>\r\n<h3>\r\n	And if the visitor isn&#39;t sure?</h3>\r\n<p>No problem, we provide contextual similar offers that will help them to go on browsing your car such as &quot;Explore More FIAT Cars&quot; or &quot;Other Convertible Cars&quot; and even a &quot;Tell your friends&quot; option to share your Car on it&#39;s favourite social network.</p>\r\n<p>If you want to see a sample page, just go to the <a href=\"\">Car Browser</a> and select any Car or just <a href=\"\">click here</a> to see this sample <a href=\"\">2011 FIAT 500 2.5 PZEV Convertible</a>.</p>\r\n','','full_html'),('node','page',0,42,42,'und',0,'<p>CarDealer includes a base of 64 popular Car Makes. You can add as many more as you want very easily. Each Car can have it&#39;s Car Make and it will be automatically shown in every place where the Car appears on your site. You can see a complete list of all the Makes included <a href=\"\">here</a>.</p>\r\n<p>The Home Page includes also a Featured Makes block that allows you to show the 8 most important makes in your stock and how many Cars each one has.</p>\r\n','','full_html'),('node','page',0,43,43,'und',0,'<p>RealEstate includes 24 Sample Properties on the default installation. Each property is a sample we place on the &quot;fresh install&quot; so you can easily see the site up and running as soon as you install it.</p>\r\n<p>Then you can start browsing, filtering them and have your site working as the one on the online demo.</p>\r\n<p><strong>IMPORTANT NOTE</strong>: All images used on sample Properties are properly licensed to DoubleMThemes and are not distributed on the downloadable package. Instead, you will get sample gray images to fit your layout.</p>\r\n<p>If you want to read more, please refer to <a href=\"http://demos.doublemthemes.com/realestate/documentation\">Installation Instructions</a> on RealEstate Online Documentation.</p>\r\n<p><img alt=\"\" ilo-full-=\"\" src=\"/realestate/sites/default/files/features/sample.jpg\" style=\"width: 746px; height: 808px;\" /></p>\r\n','','full_html'),('node','page',0,44,44,'und',0,'<p>Special Tags allows you to feature your Properties on the Listings. You can set them as &quot;Featured&quot;, &quot;Reduced&quot;, &quot;New Sale&quot; and even &quot;SOLD&quot; in case you want to show the type of Properties you have already sold. :)</p>\r\n<p><img alt=\"Special Tags on Cars - CarDealer Premium Drupal Theme\" src=\"/realestate/sites/default/files/features/specialtags.jpg\" style=\"width: 746px; height: 777px;\" /></p>\r\n','','full_html'),('node','page',0,45,45,'und',0,'<p>In case visitors wan&#39;t to make any general question or just ask for a special topic, they can use the sitewide Contact Form to get in touch with you. There you can also place your local address and even set up your location on a Google Map.</p>\r\n','','full_html'),('node','page',0,47,47,'und',0,'<p>Usability is one of the most important features included on CarDealer. Just give a look at this picture, it will tell you out how many things allows your visitors to know where they are, what to do next, call to action buttons, complementary ways to go on and so.</p>\r\n','','full_html'),('node','page',0,48,48,'und',0,'<p>In RealEstate, everything is Taxonomy based. It means that you can extend things as most as you want: beds, baths, property types, Agents and everything you can select for a property.</p>\r\n<p>Read &quot;<a href=\"http://demos.doublemthemes.com/realestate/documentation/#!/features\">Extending Property Taxonomy</a>&quot; on RealEstate Online Documentation to learn more.</p>\r\n<p><img alt=\"\" ilo-full-=\"\" src=\"/realestate/sites/default/files/features/tax.jpg\" style=\"width: 746px; height: 652px;\" /></p>\r\n','','full_html'),('node','home_item',0,49,49,'und',0,'<p>Each Property supports the linkage with an Agent, allowing your business to expand to any one interest on posting a House on your site, even owners.</p>\r\n','','filtered_html'),('node','home_item',0,50,50,'und',0,'<p>RealEstate easilly showcases all your properties on a Google Map once you locate them, allowing your visitors to explore the entire area geographically.</p>\r\n','','filtered_html'),('node','home_item',0,51,51,'und',0,'<p>Build over Drupal, the most flexible and powerfull CMS ever. RealEstate is based on an Installation Profile. Once you install it, you&#39;ll have an exact site like this.</p>\r\n','','filtered_html'),('node','page',0,54,54,'und',0,'<p>RealEstate Premium Drupal 7 Theme includes 3 major Home Page variants, deppending on your style of presenting properties. The default Home Variant used on the theme is #3, a Corporate Home Page where you can showcase your desired properties on a pretty wide slideshow.</p>\r\n<p>The second main Home Variant is the GoogleMap Home, where a huge map allows your visitors to explore all your properties geographically and browse your listings directly from above :)</p>\r\n<p>A new third Home Variant includes MD Slider, a Premium awesome Slideshow that allows creating custom slides with independent element transitions.</p>\r\n<h2>\r\n	Selected Properties Showcase</h2>\r\n<p>The main Home Variant allows you to &quot;widely&quot; showcase your most important properties on a pretty jQuery Slideshow. Includes a set of sortable blocks for filtering, promoting your services and features, showing recent properties, searching, customer comments and introduce your most popular agents.</p>\r\n<h2>\r\n	Exploring from above</h2>\r\n<p>Maps are very popular nowaday, and Google provides the most popular API for it: Google Maps API 3. So, if you&#39;re interested, you can set this Home Variant and provide your visitors a Gmap with all your properties, automtically zoomed in the properties area, allowing them to explore your listings geographically.</p>\r\n<p><img alt=\"\" src=\"/realestate/sites/default/files/features/homes.jpg\" /></p>','','full_html'),('node','page',0,55,55,'und',0,'<p>The Property Page is the core of RealEstate. It allows you to explore every detail concerning a specific property, know and explore the location and surrounding areas of it, the contact details of the Agent, an automated contat form to get in touch with them and other similar properties.</p>\r\n<p><img alt=\"\" src=\"/realestate/sites/default/files/features/page1.jpg\" /></p>\r\n<p>Following graphic explains the visual components on each Property Page. You can also explore a <a href=\"properties/2220-matrix-park-ave-raleigh-nc-23100\">sample property page</a>&nbsp;or just use the <a href=\"properties-browser\">Properties Browser</a> to browse others.</p>\r\n<p><img alt=\"\" src=\"/realestate/sites/default/files/features/page2.jpg\" style=\"width: 746px; height: 882px;\" /></p>\r\n<p>And then Faceted Search does the rest.</p>\r\n<p><img alt=\"\" src=\"/realestate/sites/default/files/features/facetedsearch.jpg\" style=\"width: 746px; height: 882px;\" /></p>\r\n','','full_html'),('node','page',0,58,58,'und',0,'<p>We aim doubts, requests and issues using a 3 way plan which includes Video Tutorials for general needs, Documentation for detailed precedures and forums for anything that can&#39;t be solved with Docs and Videos. Feel free to contact us once you buy Slash in case you need it, it is included in your price and we will support you.</p>\r\n\r\n<h2>\r\n	VideoTutorials + Documentation + Support</h2>\r\n<p><img alt=\"\" src=\"sites/default/files/features/support.jpg\" style=\"max-width: 100%; height: auto;\" /></p>\r\n<h2>\r\n	RealEstate Video Tutorials</h2>\r\n<p>RealEstate has a wide set of HD Video Tutorials that allows you to know how to proceed in certain circunstances while you interact with the theme and the backend itself.</p>\r\n<p>Following is a list of main videos of RealEstate:</p>\r\n<ul>\r\n	<li>\r\n		<a href=\"https://www.youtube.com/watch?v=2Cd3-if0GCk&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=1\" target=\"_blank\"    >Installing RealEstate Drupal Theme</a></li>\r\n	<li>\r\n		<a href=\"https://www.youtube.com/watch?v=2aDL2MIKUGY&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=2\" target=\"_blank\" >UI & UX Preview Tour - RealEstate Responsive Drupal Theme</a></li>\r\n	\r\n<li>\r\n		<a href=\"https://www.youtube.com/watch?v=-FuculjMOng&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=3\" target=\"_blank\" >Adding a New Property - RealEstate Drupal theme</a></li>\r\n<li>\r\n		<a href=\"https://www.youtube.com/watch?v=FCf072plnLg&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=4\" target=\"_blank\" >Change Site Logo - RealEstate Responsive Drupal Theme</a></li>\r\n<li>\r\n		<a href=\"https://www.youtube.com/watch?v=FCf072plnLg&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=5\" target=\"_blank\" >Setting Up Social Media Profiles - RealEstate Responsive Drupal Theme</a></li>\r\n<li>\r\n		<a href=\"https://www.youtube.com/watch?v=FCf072plnLg&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=6\" target=\"_blank\" >Setting your Google Map Area - RealEstate Responsive Drupal Theme</a></li>\r\n<li>\r\n		<a href=\"https://www.youtube.com/watch?v=FCf072plnLg&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=7\" target=\"_blank\" >Change the Contact Form Mail - RealEstate Responsive Drupal Theme</a></li>\r\n<li>\r\n		<a href=\"https://www.youtube.com/watch?v=FCf072plnLg&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=8\" target=\"_blank\" >Changing Testimonials - RealEstate Responsive Drupal Theme</a></li>\r\n<li>\r\n		<a href=\"https://www.youtube.com/watch?v=FCf072plnLg&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=9\" target=\"_blank\" >Changing the Properties Browser Intro - RealEstate Responsive Drupal Theme</a></li>\r\n<li>\r\n		<a href=\"https://www.youtube.com/watch?v=FCf072plnLg&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=10\" target=\"_blank\" >Changing the Footer Text - RealEstate Responsive Drupal Theme</a></li>\r\n<li>\r\n		<a href=\"https://www.youtube.com/watch?v=FCf072plnLg&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=11\" target=\"_blank\" >Creating a New Page - RealEstate Responsive Drupal Theme</a></li>\r\n<li>\r\n		<a href=\"https://www.youtube.com/watch?v=FCf072plnLg&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=12\" target=\"_blank\" >Adding a Twitter Block - RealEstate Responsive Drupal Theme</a></li>\r\n<li>\r\n		<a href=\"https://www.youtube.com/watch?v=FCf072plnLg&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=13\" target=\"_blank\" >Updating Drupal Core Version - RealEstate Responsive Drupal Theme</a></li>\r\n<li>\r\n		<a href=\"https://www.youtube.com/watch?v=FCf072plnLg&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la&index=14\" target=\"_blank\" >Optimizing Database Backup - RealEstate Responsive Drupal Theme</a></li>\r\n<li>\r\n		Many more videos can be found at <a href=\"https://www.youtube.com/watch?v=2Cd3-if0GCk&list=PLtB1ktcnJ7IVsFy7wjVWGYVuuEcTzs8la\" target=\"_blank\" >RealEstate Video Tutorials</a>.</li>\r\n\r\n</ul>\r\n<h2>\r\n	RealEstate Documentation</h2>\r\n<p>To read all RealEstate Documentation (it is also included on the package once you buy RealEstate), but can also previewed here http://demos.doublemthemes.com/realestate/documentation/</p>','','full_html'),('node','page',0,59,59,'und',0,'<p>RealEstate seems awesome on tablet/mobile devices! It allows you to showcase your site everywhere and allow everybody to get the most of your properties and your content. Responsive layouts are a MUST nowadays, as each time more people use their smartphones and tablets over browsing on a desktop computer.</p>\r\n<p>RealEstate has a&nbsp;4 Level <strong>Fully Responsive Layout</strong> based on <strong>HTML5 and CSS3</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>iPhone/Android mobile devices on Portrait Mode</strong></li>\r\n\r\n       <li>\r\n		<strong>iPhone/Android mobile devices on Landscape Mode</strong></li>\r\n	<li>\r\n		<strong>iPad/Tablet PC devices in Portrait</strong> and <strong>Landscape</strong> mode layout</li>\r\n	<li>\r\n		<strong>Normal and Wide Screen Desktop</strong>&nbsp;for Netbooks, Mac or PC.</li>\r\n</ul>\r\n<p><img alt=\"\" src=\"sites/default/files/features/retina.jpg\" style=\"max-width: 100%; height: auto;\" /></p>','','full_html'),('node','page',0,60,60,'und',0,'<p>RealEstate is a site conceibed to do the same job as a Real Estate Agent does, but online. Is a theme prepared to showcase your Properties while you\'re talking to another client, while you\'re having breakfast and even when you sleep! :D It allows your visitors to explore and take a look at your entire collection of Properties and get in contact with you very easilly with a simple base message they can edit: </p>\r\n	\r\n	<h5>\"I\'m interested on the property located at 3317 Raven Road Raleigh NC, 33040 and priced at $ 220 000.00.\"</h5>\r\n	\r\n	<p>So, how does the visitor\'s flow goes:</p>\r\n	\r\n	<h4>You impact on your Home Page with you best offers</h4>\r\n	\r\n	<p>Your Home Page is the first impression on your business. If your first impression is great, then everything is great.</p>\r\n	\r\n	<p>The Home Page in RealEstate can be arranged at your own style, as it includes a lot of blocks you can arrange by your own and build your own Home Page. We just offer 2 main Home Variants, one based on a Map, and the other one on a Slideshow.</p>\r\n	\r\n	<img src=\"sites/default/files/features/100.jpg\" style=\"max-width: 100%; height: auto; \" />	\r\n	\r\n	<h4>Blocks you can use:</h4>\r\n	\r\n	<p>You can re-arrange and use the following Home blocks on your Home Page:</p>\r\n	\r\n	<p><img src=\"sites/default/files/features/66.7.jpg\" style=\"max-width: 100%; height: auto;\" /></p>\r\n		\r\n	<h4>Visitors Browse your collection looking for a Property</h4>\r\n	\r\n	<p>If somebody gets in, 99% of the chances is he(or she)\'s looking for a Property. There\'s where the Properties Browsers do the rest for you. From now on, visitors define what they want to see and how, and there\'s where Filters came into play.</p>\r\n	\r\n	<p><img src=\"sites/default/files/features/5.51.jpg\" style=\"max-width: 100%; height: auto; \"/></p>\r\n	\r\n	<h4>Visitors take a look at one or more Properties</h4>\r\n	\r\n	<p>Once a visitor takes a look at a Property, he lands on the Property Page. These pages are conceibed to detail every Property aspect and to provide Contact access to interested visitors who may become potential customers.</p>\r\n	\r\n	<p><img   src=\"sites/default/files/features/5.7.jpg\" style=\"max-width: 100%; height: auto;\" /></p>\r\n	\r\n	<h4>Faceted Search does the rest</h4>\r\n	\r\n	<p>And how about if your visitor is looking for a Residential Property, but he isn\'t lookinng at the right one. Faceted Search does the rest for you. It\'s something like \"Would you like to see other Residentials? Take a look at these!\" or just \"Take a look at other by the agent Sarah Collins you might also like.\" Isn\'t enough? Then \"Take a look at our cheapest, our new sale ones or just keep filtering!\"</p>\r\n	\r\n	<p><img src=\"sites/default/files/features/102.jpg\" style=\"max-width: 100%; height: auto; \" /></p>\r\n		\r\n	<h4>Social Sharing Spreads the word</h4>\r\n	\r\n	<p>And how about if I might not like this Property but any of my friends might? Well, share it with them in your favourite Social Media network. :)</p>	\r\n	\r\n	<p><img  src=\"sites/default/files/features/103.jpg\" style=\"max-width: 100%; height: auto;\" /></p>','','full_html');
