DROP TABLE IF EXISTS `menu_position_rules`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `menu_position_rules` (
  `rid` int(11) NOT NULL AUTO_INCREMENT COMMENT 'The primary identifier for a rule.',
  `admin_title` varchar(255) DEFAULT NULL COMMENT 'The administrative title of this rule.',
  `enabled` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT 'Whether the rule is enabled or not.',
  `conditions` text COMMENT 'The serialized conditions for this rule.',
  `menu_name` varchar(32) NOT NULL DEFAULT '' COMMENT 'The menu of the menu link for this rule.',
  `plid` int(11) DEFAULT NULL COMMENT 'The parent menu link id for this rule.',
  `mlid` int(11) DEFAULT NULL COMMENT 'The menu link id for this rule.',
  `weight` tinyint(4) DEFAULT '0' COMMENT 'The weight of this rule.',
  `machine_name` varchar(255) DEFAULT NULL COMMENT 'The machine name.',
  PRIMARY KEY (`rid`),
  UNIQUE KEY `machine_name` (`machine_name`),
  KEY `rule_enabled` (`enabled`,`weight`,`rid`),
  KEY `rule_weight` (`weight`,`rid`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='Stores breadcrumb rules for nodes.';
